import {useParams} from 'react-router-dom';

function CommonBlog(props){
    let {id}=useParams();
    return(
        <div>
            <h1>Common Blog page</h1>
            {props.data.filter((items)=>items.title===id).map(items=>(
                <div>
                    <h1>{items.title}</h1>
                    <p>{items.content}</p>
                </div>
            ))}
        </div>
    )
}

export default CommonBlog
